    var windowWidth = $(window).width();

    $(window).on('resize', function(){
      windowWidth = $(window).width();
    });

    $(document).on("click",".legend-item",function(e){
        if ( windowWidth < 768 ) {
            $('.legend-item').removeClass('active');
            $(this).addClass('active');

            $('.map-legend').addClass('hidden');
            $('.map-legend-mob').addClass('hidden');

            var text = $(this).attr("data-filter-map");
            if(text) filterMarkers(text);
            else moveToLocation();
            return false;
        } else {
            $('.legend-item').removeClass('active');
            $(this).addClass('active');
            $('.legend-item_all').animate({
                  height: '45px'
            });

            var text = $(this).attr("data-filter-map");


            if(text) filterMarkers(text);
            else moveToLocation();
            return false;
        }
    });

    $(document).on('click', '.legend-item_all', function(){
      if (windowWidth > 768) {
            $('.legend-item_all').animate({
                  height: '0'
            });
      }
    });

    $(document).on('click', '.map-legend-mob', function() {
      if($(this).hasClass('hidden')) {
            $(document).find('.map-legend').removeClass('hidden');
            $(this).removeClass('hidden');
            return false;
      } else {
            $(document).find('.map-legend').addClass('hidden');
            $(this).addClass('hidden');
            return false; 
      }
    });
